INSERT INTO `jos_fussball_spiel` VALUES (4,2,4,1,'2008-03-17 19:30:00','<p>Nachdem wir gut begonnen haben und uns in den ersten 10 Min. ein paar gute Tormöglichkeiten erspielt hatten wurde der Gast aus Gescher stärker und kam durch zwei individuelle Fehler zu zwei Treffern.</p><p>Bei beiden Gegentoren sah unsere Defensivabteilung nicht unbedingt gut aus.</p><p>Trotz der Gegentreffer ließen wir aber die Köpfe nicht hängen und gingen noch in der ersten Halbzeit durch zwei schöne Treffer ( besonders das zweite Tor war sehenswert ) von Stefan Hüging und einem Tor von Norbert Roßkamp in Führung.</p><p>Nachdem Seitenwechsel und etlichen Spielerwechsel ( <u>insgesamt kamen gestern 20 Spieler zum Einsatz</u> ) haben wir das Spiel immer mehr in den Griff bekommen und uns weitere gute Möglichkeiten erspielt, die dann auch zu den weiteren Treffern durch Norbert Roßkamp, zweimal Benny Sicking und einem \"tollen\" Schuß aus ca. 30 mtr von Alex Kerkhoff führten.</p><p>Besonders erfreulich war die große Anzahl der Spieler, die auch alle eingesetzt wurden und das trotz der vielen Wechsel in der Halbzeit der Spielfluss nicht gelitten hat und wir in beiden Halbzeiten eine gute Partie abgeliefert haben.</p>',7,2,1),(5,2,5,1,'2008-03-04 19:30:00','<p>Trimbach ging nach einer Flanke und einem \"Durcheinander\" im 16er in Fühurung.</p><p>Nach ca. 10 Min in Halbzeit 2 glichen wir aus - Eigentor durch einen Spieler von Trimbach.</p><p>Dafür, dass die unser erstes Spiel war sah die Sache recht ordentlich aus.</p><p>Man muss auch dabei sagen, dass wir insgesamt 16 Feldspieler (! ! !) zur Verfügung hatten und </p><p>dementsprechend durchgewechselt haben, damit alle Spieler zum Einsatz kamen.</p>',1,1,1),(6,1,1,6,'2008-04-21 19:00:00','',6,0,1),(7,1,1,7,'2008-05-07 19:00:00','',1,5,1),(8,1,1,8,'2008-05-21 19:00:00','',2,1,1),(9,1,9,1,'2008-05-26 19:00:00','',5,3,1),(10,1,1,10,'2008-05-31 15:00:00','',10,4,1),(11,1,1,11,'2008-06-16 18:30:00','',3,8,1),(12,3,1,12,'2007-12-28 00:00:00','',1,4,1),