4,'2012-01-21 13:00:00','Hallentunier: Tecis Cup 2012',2,2,5),(195,3,97,1,'2012-01-21 14:00:06','Hallentunier: Tecis Cup 2012',2,0,5),(196,3,101,1,'2012-01-21 15:24:00','Hallentunier: Tecis Cup 2012',3,3,5),(197,3,1,98,'2012-01-21 15:48:20','Hallentunier: Tecis Cup 2012',5,3,5),(198,3,102,1,'2012-01-21 17:12:00','Hallentunier: Tecis Cup 2012',2,5,5),(199,3,1,100,'2012-01-21 18:00:00','Hallentunier: Tecis Cup 2012',5,4,5),(200,3,99,1,'2012-01-21 19:24:00','Hallentunier: Tecis Cup 2012',4,5,5),(201,3,9,1,'2012-01-28 11:00:55','Hallentunier: SF Klein Reken',1,0,5),(202,3,1,103,'2012-01-28 11:43:51','Hallentunier: SF Klein Reken',1,1,5),(203,3,1,104,'2012-01-28 12:25:55','Hallentunier: SF Klein Reken',1,1,5),(204,3,1,76,'2012-01-28 14:12:56','Hallentunier: SF Klein Reken',3,3,5),(205,3,5,1,'2012-01-28 15:00:13','<p>Hallentunier: SF Klein Reken   </p><p>&nbsp;</p><p>ungeschlagen Vorrunden aus<img src=\"plugins/editors/tinymce/jscripts/tiny_mce/plugins/emotions/images/smiley-cry.gif\" border=\"0\" alt=\"Cry\" title=\"Cry\" /></p>',2,1,5),(206,1,1,29,'2012-04-23 19:02:00','<p>Erstes Spiel und sofort verloren</p><p>Kopf hoch !!!</p><p>5Tore Auswärts ist schon was </p><p>4 Tore von Cartsen </p><p>&nbsp;</p><p>Nächstes mal haben die Sippelköppe bestimmt einen besseren Platz.</p><p>(geht auch nicht mehr schlechter...)</p>',7,5,5),(207,1,1,6,'2012-04-30 19:05:00','<p>Ein spannendes Spiel </p><p>Die neuen Trikots brauchen noch etwas bis sie funktionieren </p>',2,1,5),(208,1,1,9,'2012-05-30 19:03:13','<p>Ein sehr spannendes Spiel.</p><p>&nbsp;</p><p>Der Erste! Punkt in neuen Trikots.</p><p>&nbsp;</p><p>3 Neue Mitglieder/Spieler  </p><p>Christian Bregenberg </p><p>Lukas Uphues</p><p>Sebastian Tegelkamp </p>',1,1,5),(209,1,1,10,'2012-06-11 19:00:53','',5,3,5),(210,1,1,11,'2012-06-18 18:36:21','<p>Der erste Sieg in der Saison</p><p> und damit beenden wir unsere Hinrunde mit 4 Punkte aus 5 Spielen.</p><p>Für Johannes Schulze Holthausen war es nicht nur der erste Sieg sondern auch,</p><p>sein  erstes Spiel überhaupt für den HSV.</p><p> \'Man of the Match\' war ganz klar Manfred Roßkamp mit seiner Kondition und denn 3Toren.</p>',3,7,5),(211,2,59,1,'2012-06-23 14:57:17','<p>Sieg für Jung</p><p>&nbsp;</p><p>Eindeutiges langweiliges Spiel, mit einigen namentlich nicht erwähnten Überläufern(manni)</p><p> Die Kondition der Alten konnte man mit einen Stein vergleichen, wobei ein Stein Berg ab es meistens bis unten schaft, wenn er ins Rollen kommt.  </p><p>Ein Lob an den sehr fairen Schiri, der mit seinen Entscheidungen immer Richtig lag und zum Glück der Alten (z.B.Frank) die Karten vergesen hat.</p><p>Dies war das erste Spiel für:</p><p>  Lars Bröring, Tobias Holtkamp, Tim Bartholme und Steffen Uphues</p><p>Das erste Tor: Michael Trepmann </p><p>und der gefühlte erste Ballkontakt: Juppi Döring </p>',6,1,5),(212,3,9,1,'2012-06-24 14:57:00','<p>Pokaltunier</p><p>&nbsp;</p>',2,2,5),(213,3,29,1,'2012-06-24 15:14:27','<p>Pokaltunier</p><p>&nbsp;</p>',1,1,5),(214,3,6,1,'2012-06-24 15:20:12','Pokaltunier',2,1,5),(215,3,77,1,'2012-06-24 15:22:42','<p>Pokaltunier</p><p>1!Platz  </p><p>&nbsp;</p><p>erstes Tor für fruti!i! </p>',5,1,5),(216,3,105,1,'2012-06-24 14:29:54','<p>Pokaltunier</p><p>&nbsp;</p>',2,0,5),(217,1,29,1,'2012-07-02 17:43:37','<p>Das Erste Heimspiel und der zweite Sieg in der jetzigen Spielzeit </p><p> </p><p>Im Spiel gegen den Tabellenführer schossen wir 6Tore, unterandern auch  </p><p> Sebastian Tegelkamp, der per Elfer sein erstes für den Hsv schoss.</p><p>Hoffentlich werden die nächsten Heimspiele auch so gut.</p><p> </p>',6,1,5),(218,1,10,1,'2012-09-19 18:45:52','',2,6,5),(219,1,11,1,'2012-09-24 19:00:00','',7,5,5),(220,1,9,1,'2012-09-03 19:19:00','',0,0,5),(221,1,9,1,'2012-09-03 19:19:00','',2,5,5),(222,1,6,1,'2012-09-10 19:25:00','',4,1,5),(223,2,36,1,'2012-09-26 16:39:59','',3,0,5),(224,3,68,1,'2013-01-06 09:43:50','',2,1,6),(225,3,109,1,'2013-01-06 11:14:29','',1,2,6),(226,3,1,106,'2013-01-06 12:06:34','',1,1,6),(227,3,107,1,'2013-01-0